on-boarding and education.

Experience as QA Lead role:

* Developed QA processes from scratch (in the scope of the Scrum process) that helped to increase the quality level of applications;
* Leading QA team (5-6 employees) to ensure quality on projects;
* At least 2k cases for one of the project has been created by me and my team (400 Smoke test cases included);
* Provided tech interviews for the company and subsequent onboarding newcomers for current projects that improved expertise of QA Competence in the company;
* Participated in internal QA School as a teacher that helped to have high-qualified specialists at junior levels;
* Trained new staff (10+ juniors ) in the scope of software testing on projects to allow employee has a high intensive grow
* Management distributed team remotely that helped to hire people from the different countries and cities to extend expertise outside current location;
* Holding regular 1:1 meetings and working with feedback, compiling IDP that helped to grow employees and prevent burnout;
* Developed automation process on projects based on the open-source framework using the BDD approach which leads to a decrease in the time for releases (more than 80% of cases are automated);
* Played the role of Scrum Master and Product Management to support the project when it was needed to keep quality and team.

QA Skills:
* Highly proficient and knowledgeable in creating and executing test cases, test plans, strategies, scenarios, etc.;
* Experience in working with databases (PostgreSQL, MSSQL, Cassandra);
* Experience in BDD approach;
* Worked in distributed remote teams;
* SDLC knowledge;
* Organized Business Demonstrations of new features for customers,

Used Tools:  AzureDevops, TestRail, Atlassian Jira/Confluence, Zephyr Plugin, Postman, Fiddler, Charles Proxy, GIT, GitLab, Jenkins


